import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import axios from 'axios';

const Deposit = () => {
  const [currentUserEmail, setCurrentUserEmail] = useState('');
  const [currentBalance, setCurrentBalance] = useState(1000.00);
  const [depositAmount, setDepositAmount] = useState('');
  const [showSuccessMessage, setShowSuccessMessage] = useState(false);

  useEffect(() => {
    const email = localStorage.getItem('userEmail');
    if (email) {
      setCurrentUserEmail(email);
      getCurrentBalance(email);
    }
  }, []);

  const getCurrentBalance = (email) => {
    axios.get('http://backend-dev2.us-east-1.elasticbeanstalk.com/get_balance', { params: { email } })
      .then(response => setCurrentBalance(response.data.balance))
      .catch(error => console.log(error));
  };

  const handleDeposit = (e) => {
    e.preventDefault();
    const amount = parseFloat(depositAmount);
    if (isNaN(amount)) {
      alert('Please enter a valid number for the deposit amount.');
      return;
    }
    if (amount < 0) {
      alert('Please enter a positive deposit amount.');
      return;
    }
    axios.post('http://backend-dev2.us-east-1.elasticbeanstalk.com/deposit', { email: currentUserEmail, amount })
      .then(() => {
        setCurrentBalance(prevBalance => prevBalance + amount);
        setShowSuccessMessage(true);
        setDepositAmount('');
      })
      .catch(error => {
        console.log(error);
        alert('Error processing deposit.');
      });
  };

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    setCurrentUserEmail('');
    alert('You have logged out.');
  };

  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-dark" style={{ backgroundColor: '#004571' }}>
        <a className="navbar-brand" href="/">Very Bad Bank</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
          <div className="navbar-nav">
            <a className="nav-item nav-link" href="/">Home</a>
            <a className="nav-item nav-link" href="/create_account">Create Account</a>
            <a className="nav-item nav-link active" href="/deposit">Deposit</a>
            <a className="nav-item nav-link" href="/withdraw">Withdraw</a>
            <a className="nav-item nav-link" href="/all_data">All Data</a>
          </div>
          <span className="navbar-text ml-auto" id="userEmail">{currentUserEmail}</span>
          <button className="btn btn-outline-light ml-2" id="logoutButton" style={{ display: currentUserEmail ? 'block' : 'none' }} onClick={handleLogout}>Logout</button>
        </div>
      </nav>

      <main role="main" className="container mt-5">
        <div className="card">
          <div className="card-body">
            <h5 className="card-title text-center">Deposit Funds</h5>
            <div className="mb-3 text-center">
              <p className="card-text">Current Balance: ${currentBalance.toFixed(2)}</p>
            </div>
            <form id="depositForm" onSubmit={handleDeposit}>
              <div className="mb-3">
                <label htmlFor="depositInput" className="form-label">Deposit Amount</label>
                <input
                  type="text"
                  className="form-control"
                  id="depositInput"
                  placeholder="Enter deposit amount"
                  value={depositAmount}
                  onChange={(e) => setDepositAmount(e.target.value)}
                />
              </div>
              <div className="d-grid gap-2">
                <button type="submit" className="btn btn-primary" id="depositButton" disabled={!depositAmount.trim()}>Deposit</button>
              </div>
            </form>
            <div className="alert alert-success mt-3" id="successMessage" style={{ display: showSuccessMessage ? 'block' : 'none' }}>
              Deposit successful!
            </div>
          </div>
        </div>
      </main>

      <footer className="py-5" style={{ backgroundColor: '#efefef' }}>
        <div className="container">
          <p className="text-center">Â©2024 Very Bad Bank, Inc. All rights reserved.</p>
        </div>
      </footer>

      <style jsx>{`
        .navbar, .card-header {
          background-color: #004571;
          color: white;
        }
        .btn-primary, .nav-link:hover {
          background-color: #ff681f;
          border-color: #ff681f;
        }
        .card {
          background-color: #fdfcfd;
        }
        body, .card-text {
          color: #000000;
        }
        footer {
          background-color: #efefef;
        }
      `}</style>
    </div>
  );
};

export default Deposit;
